INSERT INTO `texts` (`id`, `text`, `section_id`) VALUES
(1, '<h4 style="box-sizing: border-box; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(170, 103, 8); margin-top: 0px; margin-bottom: 5px; font-size: 18px; background-color: rgb(255, 255, 255);">Accessible icons</h4><p style="box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">Modern versions of assistive technologies will announce CSS generated content, as well as specific Unicode characters. To avoid unintended and confusing output in screen readers (particularly when icons are used purely for decoration), we hide them with the&nbsp;<code style="box-sizing: border-box; font-family: Menlo, Monaco, Consolas, ''Courier New'', monospace; font-size: 12.6px; padding: 2px 4px; color: rgb(199, 37, 78); border-radius: 3px; background-color: rgb(249, 242, 244);">aria-hidden="true"</code>&nbsp;attribute.</p><p style="box-sizing: border-box; margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">If you''re using an icon to convey meaning (rather than only as a decorative element), ensure that this meaning is also conveyed to assistive technologies – for instance, include additional content, visually hidden with the&nbsp;<code style="box-sizing: border-box; font-family: Menlo, Monaco, Consolas, ''Courier New'', monospace; font-size: 12.6px; padding: 2px 4px; color: rgb(199, 37, 78); border-radius: 3px; background-color: rgb(249, 242, 244);">.sr-only</code>&nbsp;class.</p><p style="box-sizing: border-box; margin: 0px; color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);">If you''re creating controls with no other text (such as a&nbsp;<code style="box-sizing: border-box; font-family: Menlo, Monaco, Consolas, ''Courier New'', monospace; font-size: 12.6px; padding: 2px 4px; color: rgb(199, 37, 78); border-radius: 3px; background-color: rgb(249, 242, 244);">&lt;button&gt;</code>&nbsp;that only contains an icon), you should always provide alternative content to identify the purpose of the control, so that it will make sense to users of assistive technologies. In this case, you could add an&nbsp;<code style="box-sizing: border-box; font-family: Menlo, Monaco, Consolas, ''Courier New'', monospace; font-size: 12.6px; padding: 2px 4px; color: rgb(199, 37, 78); border-radius: 3px; background-color: rgb(249, 242, 244);">aria-label</code>&nbsp;attribute on the control itself.</p>', 1),
(2, '<h1 style="box-sizing: border-box; margin: 0px 380px 10px 0px; font-size: 60px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-weight: 500; line-height: 1; color: rgb(255, 255, 255); background-color: rgb(111, 84, 153);">Components</h1><p style="box-sizing: border-box; margin: 0px 380px 0px 0px; line-height: 1.4; color: rgb(205, 191, 227); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 24px; background-color: rgb(111, 84, 153);">Over a dozen reusable components built to provide iconography, dropdowns, input groups, navigation, alerts, and much more.</p>', 2);

